using AutoMapper;
using FluentValidation;
using MicrobUy_API.Dtos;
using MicrobUy_API.Dtos.Enums;
using MicrobUy_API.Models;

namespace MicrobUy_API.Data.SeedData
{
    public class SeedInstancia
    {
        private static TenantAplicationDbContext _context;
        private static IMapper _mapper;

        public static void RunSeedInstances(TenantAplicationDbContext context, IMapper mapper)
        {
            _context = context;
            _mapper = mapper;

            try
            {
                if (!_context.TenantInstances.Any())
                {
                    var instances = new List<CreateInstanceRequestDto>
                {
                   new CreateInstanceRequestDto
                   {
                        Nombre = "Todo Deporte",
                        Dominio = "tododeporte",
                        Logo = "data:image/jpeg;base64,",
                        Activo = true,
                        Tematica = new CreateTematicaRequestDto { Name = "Deportes" },
                        Description = "Hablemos sobre deporte, los grandes como el futbol y también los deportes menores",
                        EsquemaColores = EsquemaColoresEnum.Claro,
                        Privacidad = PrivacidadEnum.Abierta
                   },

                    new CreateInstanceRequestDto
                    {
                        Nombre = "Política Uruguaya",
                        Dominio = "politicauy",
                        Logo = "data:image/jpeg;base64,",
                        Activo = true,
                        Tematica = new CreateTematicaRequestDto { Name = "Opiniones" },
                        Description = "Opiniones, comentarios del acontecer político del Uruguay",
                        EsquemaColores = EsquemaColoresEnum.Claro,
                        Privacidad = PrivacidadEnum.Abierta
                    },

                      new CreateInstanceRequestDto
                    {
                        Nombre = "Cinema",
                        Dominio = "cinemahoy",
                        Logo = "data:image/jpeg;base64,",
                        Activo = true,
                        Tematica = new CreateTematicaRequestDto { Name = "Compartir historias" },
                        Description = "Habelmos de la farandula de Hollywood",
                        EsquemaColores = EsquemaColoresEnum.Oscuro,
                        Privacidad = PrivacidadEnum.Abierta
                      },
                };

                    List<string> plataforUsers = new List<string> { "alice_jackson@microbuy", "john_doe@microbuy", "jane_smith@microbuy" };
                    int index = 0;

                    foreach (var instance in instances)
                    {

                        TenantInstanceModel newInstance = _mapper.Map<TenantInstanceModel>(instance);
                        UserModel userExist = _context.User.Where(x => x.UserName == plataforUsers.ElementAt(index)).FirstOrDefault();

                        newInstance.InstanceAdministrators = new List<UserModel> { userExist };
                        newInstance.CreationDate = DateTime.Now;

                        _context.Add(newInstance);

                        index++;
                    }

                    _context.SaveChanges();
                }
            }
            catch (Exception ex)
            {

                throw ex;
            }
        }
    }
}
